import React from "react";
import '../styles/About.css';
import aboutBackground from '../images/about-background.png';

function About() {
  return (
    <div className="about">
      <div id="about-image">
        <img src={aboutBackground} alt='about background'/>
      </div>
      <div className="about-body">
        <div className="about-title">About Us</div>
        <div className="about-description">Meo edita eam adsit vobis operi. Re tria mo aspi adeo igni ecce to de. 
        Qualitates co ostenditur agnoscitur ac effecerunt apprehendo. Cui expectanti diversitas lor ita varietates
        imo contrariae religionis.</div>
      </div>
    </div>
  )
}

export default About;
